import React from "react";
import { Button, Card } from "react-bootstrap"



let cartDetails = ({title, discription, clickme, img, children}) => {

function clickHandle() {
  clickme(title)
}

    return (

         <Card style={{ width: '300px'}}>
          <Card.Img variant="top" src={img}/>
          <Card.Body>
            <Card.Title>{title}</Card.Title>
            <Card.Text>
            {discription}
            </Card.Text>
            <Button clickme={clickHandle} variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
 
      );
}


export default cartDetails
